&lt;p&gt;&lt;a href="http://www.flickr.com/people/jcbwalsh/"&gt;jcbwalsh&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/jcbwalsh/4976065889/" title="Victory in Union Square"&gt;&lt;img src="http://farm5.static.flickr.com/4111/4976065889_3488bf1fee_m.jpg" width="240" height="154" alt="Victory in Union Square" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The statue of &amp;quot;Victory&amp;quot; stands 97 feet above Union Square in the heart of San Francisco. It was installed in 1903 to commemorate Admiral Dewey's victory at the Battle of Manila Bay in the Spanish-American War. The monument also recognizes President McKinley, who had been assissinated two years before. Union Square itself stands atop the world's first underground parking garage&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/carbonnyc/"&gt;CarbonNYC&lt;/a&gt; posted a photo:&lt;/p&gt;

