&lt;p&gt;Bryon described to reproductive biology and ecology and chronology of a swarming event, after we'd successfully conveyed the colony to a new hive. We left them to get settled and wandered back past the Dahlia Garden. (Prepare for some &lt;i&gt;flower macros&lt;/i&gt;!!!)&lt;/p&gt;

