&lt;p&gt;Characters:&lt;br /&gt;
&lt;br /&gt;
Checkers- a Muscovy drake with a hamburger face and a cranky disposition to suit it . He is slovenly at times and often quite lazy spending an enormity of time looking at his toenails and picking at his back. In the recent past he has shown occasional sexual interest in a  female wood duck named Rocci.&lt;br /&gt;
&lt;br /&gt;
Rocci - female wood duck, fastidious and neat as a pin and with the quickness of Speedy Gonzalez allowing her to escape the amorous advances of the clumsy red faced drake. She would much rather the relationship be on a platonic footing. She likes her big silly red faced friend.&lt;br /&gt;
&lt;br /&gt;
Private Slowski - an extra who happened to be one of 1,000's of turtles who auditioned for the part.&lt;/p&gt;

