&lt;p&gt;&lt;a href="http://www.flickr.com/photos/35917634@N05/4979464069/" title="Original St. Mary's College"&gt;&lt;img src="http://farm5.static.flickr.com/4087/4979464069_c48f613e13_m.jpg" width="240" height="165" alt="Original St. Mary's College" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Church of St. John the Evangelist, original site of St. Marys College; Church of St. John the Evangelist, 19 Saint Marys Avenue near Mission Street, Bernal Heights District, San Francisco CA&lt;br /&gt;
&lt;br /&gt;
&amp;quot;Founded in 1863 by the Roman Catholic Archdiocese of San Francisco, Saint Mary's College of California is one of the oldest colleges in the West.The College campus originally was located in San Francisco, and operated for several years under Archdiocesan direction . . . In 1889, the campus was moved to Oakland's Brickpile facility, where the College operated until 1928, when it moved to Moraga.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
&amp;quot;St. Mary's College was located within what now are the boundaries of St. John's Parish.  The original St. Mary's chapel bell was placed in the west tower of St. John's Church in 1903.  The bell was removed from the tower in 1979 and returned to St. Mary's on the occasion of the college's 125th anniversary.&amp;quot;&lt;/p&gt;

