&amp;quot;The San Francisco, Casa de Barro church is located in San Francisco, CA and is part of the Free Methodist Church of North America denomination of churches.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
&amp;quot;The Free Methodist Church is a Methodist Christian denomination within the holiness movement. It is evangelical in nature and has its roots in the Arminian-Wesleyan tradition.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
&amp;quot;The Free Methodist Church was founded in 1860, primarily as a result of controversies within the Genesee Conference of the Methodist Episcopal Church. The principal founder was Benjamin T. Roberts (1823-1893)&amp;quot;&lt;/p&gt;

