&lt;p&gt;&lt;a href="http://www.flickr.com/photos/35917634@N05/4980066294/" title="St. Paul's Spires"&gt;&lt;img src="http://farm5.static.flickr.com/4089/4980066294_20187566d2_m.jpg" width="142" height="240" alt="St. Paul's Spires" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;St. Paul's Catholic Church, 29th and Church Streets, Noe Valley District, San Francisco CA&lt;br /&gt;
&lt;br /&gt;
St. Paul's traces its history back to 1876 when George Shadbourne communicated a desire to Archbishop Joseph Alemany to have a new parish established, as well as a willingness to help collect money, purchase land, and construct a parish church. Archbishop Alemany approved the request, and in 1880 a church building and a residence for the pastor was built. This first church, which seated up to 750 people served approximately 200 families. By 1897 growth led the parish to begin construction on the current 1,400 seat English Gothic structure . . . The new church was dedicated on May 29, 1911 by Archbishop Patrick Riordan . . . In 1992, the parish became the site of filming for the comedy movie Sister Act.&amp;quot;&lt;/p&gt;

